import React from 'react';
import styles from './NeonSign.module.css';

const NeonSign = () => (
  <header className={styles.neonSign}>
    <h1 className={styles.neonText}>Sofia Peixoto Barbosa</h1>
    <h2 className={styles.subtitle}>Artista dos Mistérios</h2>
  </header>
);

export default NeonSign;
